                      /* ctype */

static const uint16_t ucs_table[];
static const uint32_t ucs_cases_table[];
static uint32_t ucs_getUCV(uint32_t);

static int
_ctypeIS(int c) {

  uint32_t ct_value;

  if (c == 0)  return 0;
  if (c <= 0x3400)  ct_value = ucs_table[c];
  else              ct_value = ucs_getUCV(c);
  if ((ct_value & 0x8000) == 0x8000)
    ct_value = ucs_cases_table[(((ct_value & 0x7FFF) << 2) + 3)];
  return (int)(ct_value & 0x0400);
}

int isprint(int c)  {  return _ctypeIS(c);  }

