static uint32_t
ucs_getUCV(uint32_t i) {

  unsigned sum = 0;

  // CJK Ideograph Extension A
  if ((i > 0x03400) && (i < 0x04DBF))  return ucs_table[0x03400];

  sum += 0x04DBF - 0x03401;
  if (i <= 0x04E00) return ucs_table[(i - sum)];
  // CJK Ideograph
  if ((i > 0x04E00) && (i < 0x09FFF)) {
    /* tricky part! Original had U4E00-U9FCC mapping to U4E00.
     * Original U4E00 had 'Lo' from unicode_data.
     * Moved to U4E01, U4E00 holds 'Nl' to add in numeric types.
     * Now want these (Japanese/Chinese numerals):
     * U4e00 U4e03 U4e07 U4e09 U4e5d U4e8c U4e94 U516b U516d U5341 U5343 U56db U767e U96f6
     * Finanical additions (Japanese):  U53c2 U58f1 U5f10 U62fe U842c
     * Finanical additions (Chinese):  U4edf U4f0d U4f70 U5104 U53c1 U58f9 U62fe U634c U67d2 U7396 U8086 U8d30 U842c U9646
     * to contain Nl. This means all that pointed to U4E00 must now point to
     * U4E01, each above listed will point to U4E00.
     */
    if (   (i != 0x4e03) && (i != 0x4e07) && (i != 0x4e09)
        && (i != 0x4e5d) && (i != 0x4e8c) && (i != 0x4e94) && (i != 0x4edf)
        && (i != 0x4f0d) && (i != 0x4f70) && (i != 0x5104) && (i != 0x516b)
        && (i != 0x516d) && (i != 0x5341) && (i != 0x5343) && (i != 0x53c1)
        && (i != 0x53c2) && (i != 0x56db) && (i != 0x58f1) && (i != 0x58f9)
        && (i != 0x5f10) && (i != 0x62fe) && (i != 0x634c) && (i != 0x67d2)
        && (i != 0x7396) && (i != 0x767e) && (i != 0x8086) && (i != 0x842c)
        && (i != 0x8d30) && (i != 0x9646) && (i != 0x96f6))
      --sum;
    return ucs_table[(0x04E00 - sum)];
  }

  sum += 0x09FFF - 0x04E02;
  if (i <= 0x0AC00) return ucs_table[(i - sum)];
  // Hangul Syllable
  if ((i > 0x0AC00) && (i < 0x0D7A3))  return ucs_table[(0x0AC00 - sum)];

  sum += 0x0D7A3 - 0x0AC01;
  if (i <= 0x0D800) return ucs_table[(i - sum)];
  if ((i > 0x0D800) && (i < 0x0DB7F))  return 0;   // no characters

  sum += 0x0DB7F - 0x0D801;
  if (i <= 0x0DB80) return ucs_table[(i - sum)];
  if ((i > 0x0DB80) && (i < 0x0DBFF))  return 0;   // no characters

  sum += 0x0DBFF - 0x0DB81;
  if (i <= 0x0DC00) return ucs_table[(i - sum)];
  if ((i > 0x0DC00) && (i < 0x0DFFF))  return 0;   // no characters

  sum += 0x0DFFF - 0x0DC01;
  if (i <= 0x0E000) return ucs_table[(i - sum)];
  if ((i > 0x0E000) && (i < 0x0F8FF))  return 0;   // no characters

  sum += 0x0F8FF - 0x0E001;
  if (i <= 0x10D39) return ucs_table[(i - sum)];
  if ((i > 0x10D39) && (i < 0x10E60))  return 0;   // no characters

  sum += 0x10E60 - 0x10D3A;
  if (i <= 0x11AF8) return ucs_table[(i - sum)];
  if ((i > 0x11AF8) && (i < 0x11C00))  return 0;   // no characters

  sum += 0x11C00 - 0x11AF9;
  if (i <= 0x11DA9) return ucs_table[(i - sum)];
  if ((i > 0x11DA9) && (i < 0x11EE0))  return 0;   // no characters

  sum += 0x11EE0 - 0x11DAA;
  if (i <= 0x12543) return ucs_table[(i - sum)];
  if ((i > 0x12543) && (i < 0x12F90))  return 0;   // no characters

  sum += 0x12F90 - 0x12544;
  if (i <= 0x13438) return ucs_table[(i - sum)];
  if ((i > 0x13438) && (i < 0x14400))  return 0;   // no characters

  sum += 0x14400 - 0x13439;
  if (i <= 0x14646) return ucs_table[(i - sum)];
  if ((i > 0x14646) && (i < 0x16800))  return 0;   // no characters

  sum += 0x16800 - 0x14647;
  if (i <= 0x16B8F) return ucs_table[(i - sum)];
  if ((i > 0x16B8F) && (i < 0x16E40))  return 0;   // no characters

  sum += 0x16E40 - 0x16B90;
  if (i <= 0x17000) return ucs_table[(i - sum)];
  if ((i > 0x17000) && (i < 0x187F7))  return 0;   // no characters

  sum += 0x187F7 - 0x17001;
  if (i <= 0x18D08) return ucs_table[(i - sum)];
  if ((i > 0x18D08) && (i < 0x1AFF0))  return 0;   // no characters

  sum += 0x1AFF0 - 0x18D09;
  if (i <= 0x1B2FB) return ucs_table[(i - sum)];
  if ((i > 0x1B2FB) && (i < 0x1BC00))  return 0;   // no characters

  sum += 0x1BC00 - 0x1B2FC;
  if (i <= 0x1BCA3) return ucs_table[(i - sum)];
  if ((i > 0x1BCA3) && (i < 0x1CF00))  return 0;   // no characters

  sum += 0x1CF00 - 0x1BCA4;
  if (i <= 0x1D245) return ucs_table[(i - sum)];
  if ((i > 0x1D245) && (i < 0x1D2E0))  return 0;   // no characters

  sum += 0x1D2E0 - 0x1D246;
  if (i <= 0x1DAAF) return ucs_table[(i - sum)];
  if ((i > 0x1DAAF) && (i < 0x1DF00))  return 0;   // no characters

  sum += 0x1DF00 - 0x1DAB0;
  if (i <= 0x1E14F) return ucs_table[(i - sum)];
  if ((i > 0x1E14F) && (i < 0x1E290))  return 0;   // no characters

  sum += 0x1E290 - 0x1E150;
  if (i <= 0x1E2FF) return ucs_table[(i - sum)];
  if ((i > 0x1E2FF) && (i < 0x1E7E0))  return 0;   // no characters

  sum += 0x1E7E0 - 0x1E300;
  if (i <= 0x1E95F) return ucs_table[(i - sum)];
  if ((i > 0x1E95F) && (i < 0x1EC71))  return 0;   // no characters

  sum += 0x1EC71 - 0x1E960;
  if (i <= 0x1FBF9) return ucs_table[(i - sum)];
  if ((i > 0x1FBF9) && (i < 0x20000))  return 0;   // no characters

  sum += 0x20000 - 0x1FBFA;
  // CJK Ideograph Extension B
  if ((i >= 0x20000) && (i < 0x2A6DF))  return ucs_table[(0x20000 - sum)];

  sum += 0x2A6DF - 0x20001;
  if (i <= 0x2A700) return ucs_table[(i - sum)];
  // CJK Ideograph Extension C
  if ((i > 0x2A700) && (i < 0x2B738))  return ucs_table[(0x2A700 - sum)];

  sum += 0x2B738 - 0x2A701;
  if (i <= 0x2B740) return ucs_table[(i - sum)];
  // CJK Ideograph Extension D
  if ((i > 0x2B740) && (i < 0x2B81D))  return ucs_table[(0x2B740 - sum)];

  sum += 0x2B81D - 0x2B741;
  if (i <= 0x2B820) return ucs_table[(i - sum)];
  if ((i > 0x2B820) && (i < 0x2CEA1))  return 0;   // no characters

  sum += 0x2CEA1 - 0x2B821;
  if (i <= 0x2CEB0) return ucs_table[(i - sum)];
  if ((i > 0x2CEB0) && (i < 0x2EBE0))  return 0;   // no characters

  sum += 0x2EBE0 - 0x2CEB1;
  if (i <= 0x2EBE0) return ucs_table[(i - sum)];
  if ((i > 0x2EBE0) && (i < 0x2F800))  return 0;   // no characters

  sum += 0x2F800 - 0x2EBE1;
  if (i <= 0x2FA1D) return ucs_table[(i - sum)];
  if ((i > 0x2FA1D) && (i < 0x30000))  return 0;   // no characters

  sum += 0x30000 - 0x2FA1E;
  if (i <= 0x30000) return ucs_table[(i - sum)];
  if ((i > 0x30000) && (i < 0x3134A))  return 0;   // no characters

  sum += 0x3134A - 0x30001;
  if (i <= 0x3134A) return ucs_table[(i - sum)];
  if ((i > 0x3134A) && (i < 0xE0001))  return 0;   // no characters

  sum += 0xE0001 - 0x3134B;
  if (i <= 0xE01EF) return ucs_table[(i - sum)];
  if ((i > 0xE01EF) && (i < 0xF0000))  return 0;   // no characters

  sum += 0xF0000 - 0xE01F0;
  if (i <= 0xF0000) return ucs_table[(i - sum)];
  // Plane 15 Private Use
  if ((i > 0xF0000) && (i < 0xFFFFD))  return ucs_table[(0xF0000 - sum)];

  sum += 0xFFFFD - 0xF0001;
  if (i <= 0x100000) return ucs_table[(i - sum)];
  // Plane 16 Private Use
  if ((i > 0x100000) && (i < 0x10FFFD))  return ucs_table[(0x100000 - sum)];

  sum += 0x10FFFD - 0x100001;
  if (i <= 0x10FFFF)  return ucs_table[(i - sum)];

  return 0;
}

